g2:c.PROCEDURE.g2:a.TEXT:
get-or-make-host-info()
  file-system:symbol = file-system-type;
  host: text;
begin
if file-system is unknown then begin
   file-system = call g2-type-of-file-system();
   conclude that file-system-type = file-system;
end;
if host-name is unknown then begin
    host = call g2-get-host-name();
    conclude that host-name = symbol(host);
end;
end

commit-recent-checksums()
   mgr: class draw-test-manager;
   RC: integer;
begin
  for mgr = each draw-test-manager do
     RC = the recent-checksum of mgr;
     if the expected-checksum of mgr /= RC then begin
           conclude that the expected-checksum of mgr = RC;
           make mgr permanent;
      end;
  end;
end

setup-printer-setup(mgr: class draw-test-manager, filename: text)
  txt: text;
begin
  txt = the desired-printer-details of mgr;
  if txt = "see the-default-draw-test-manager" then 
     txt = the desired-printer-details of the-default-draw-test-manager;
  change the text of the printing-details of printer-setup to txt;
 
  txt = the desired-page-layout of mgr;
  if txt = "see the-default-draw-test-manager" then 
     txt = the desired-page-layout of the-default-draw-test-manager;
  change the text of the page-layout of printer-setup to txt; 


change the text of the print-spooling of printer-setup to
"Spooled filename template: @"[filename]@";
Spool file to printer: no;
Printer identification: @"unknown@"";
end

unix-print(test-name: symbol, wks: class kb-workspace) = (item-or-value)
  filename: text = "[test-name]-[host-name]";
  dir: text = "/bt/ab/junk/test-spool";
  postscript-filename: text = "[dir]/[filename].ps";
  checksum-filename: text = "[dir]/[filename].cs";
  result-checksum: item-or-value;
  result-stream: class g2-stream;
  resulting-checksum-line: text;
  sym: symbol; txt:text;
  flag: truth-value;
  i:integer;
  cmd:text;
  pid: float;
  rsh: text = "rsh";
 begin
  call setup-printer-setup(the draw-test-manager upon wks, postscript-filename);
  call maybe-delete-file(postscript-filename);
  call maybe-delete-file(checksum-filename);
  print wks;
  allow other processing; { printing is high prioity in here }
  flag = call g2-file-exists("/usr/bin/remsh");
  if flag then rsh = "remsh";
  cmd = "[rsh] baltimore /bt/ab/util/sum-ps [filename]";
  pid = call g2-spawn-process-to-run-command-line(cmd);
  {inform the operator that "Hi([pid]): [cmd]";}
  for i = 1 to 20 do
    allow other processing;
    flag = call g2-file-exists(checksum-filename);
    exit if flag;
    wait for 5 seconds;
  end;
  wait for 10 seconds;
  if not(flag) then signal the symbol printing-to-checksum-timed-out,"Printing to checksum file [checksum-filename] timed-out after 100 seconds";
  result-stream = call g2-open-file-for-read(checksum-filename);
  resulting-checksum-line = call g2-read-line(result-stream);
  begin
    result-checksum = quantity(resulting-checksum-line);
  end on error (sym,txt)
     result-checksum = symbol(resulting-checksum-line);
  end;
  return result-checksum;
end

print-for-checksum (test-name: symbol, wks: class kb-workspace) { May unwind to indicate error}
  test-checksum: item-or-value;
  expected-checksum: integer;
begin
  case (file-system-type) of
  unix: test-checksum = call unix-print(test-name, wks);
  vms: test-checksum = call vms-print(test-name, wks);
  win32: test-checksum = call win32-print(test-name, wks);
  otherwise: signal the symbol unknown-file-system-type, "[file-system-type] is not a recognized file system type."
  end;
  if test-checksum is an integer then
     conclude that the recent-checksum of the draw-test-manager upon wks = test-checksum;
  if test-checksum is a symbol and test-checksum is unavailable then return;
  expected-checksum = the expected-checksum of the draw-test-manager upon wks;
  if test-checksum is an integer and test-checksum = expected-checksum then return;
  signal the symbol bad-printing-checksum, "[test-checksum] was not the expected checksum i.e. [expected-checksum]";
end

ring-changes-on-showing(wks: class kb-workspace)
begin
    show wks at one-quarter scale with its right center at the right center of the screen ;
    wait for heart-beat;
    show wks at half scale with its right center at the right center of the screen ; 
    wait for heart-beat;
    show wks at three-quarter scale with its right center at the right center of the screen ; 
    wait for heart-beat;
    show wks at full scale with its right center at the right center of the screen ;
    wait for heart-beat ;
    show wks at full scale with its right center at the right center of the screen;
    wait for heart-beat ;
    show wks at full scale with its top right corner at the top right corner of the screen;
    wait for heart-beat ;
    hide wks;
end

c.DRAW-TEST-MANAGER.ua.DESIRED-PAGE-LAYOUT:
Paper size: letter;
Paper orientation: portrait;
Left margin: 0.5 inch;
Top margin: 0.5 inch;
Right margin: 0.5 inch;
Bottom margin: 0.5 inch

g2:c.PROCEDURE.g2:a.TEXT:
do-draw-test (block: class test-block)
   wks: class kb-workspace = the subworkspace of block;
begin
    call get-or-make-host-info();
    call ring-changes-on-showing(wks);
    show wks;
    hide wks;
    call print-for-checksum(the name of block, wks); { may unwind}
    call report (block, the symbol passed, "Do draw test");
end

maybe-delete-file(filename: text) 
flag: truth-value; 
begin 
  flag = call g2-file-exists(filename);
  if flag then call g2-delete-file (filename);
end
